import React, { useState } from "react";



export default function Create(){
    const [input, setInput] = useState({
        name:'',
        hp:0,
        attack:0,
        defense:0,
        speed:0,
        height:0,
        weight:0,
        image:'',
        type1:'',
        type2:''
    })

    return(
        <div>

            <div>
                <form>
                    <label htmlFor='name'>Name:</label>
                    <input
                        type='text'
                        name='name'
                        value={input.name}
                    />
                    <div>
                        <h4>Stats</h4>
                        <label>Health Points:</label>
                        <input></input>
                        <label>Attack:</label>
                        <input></input>
                        <br/>
                        <label>Defense:</label>
                        <input></input>
                        <label>Speed</label>
                        <input></input>
                    </div>
                    <br/>
                    <label>Height:</label>
                    <input></input>
                    <label>Weight:</label>
                    <input></input>
                    <br/>
                    <label>Image:</label>
                    <input></input>
                    <br/>
                    <label>Types</label>
                    <input></input>
                    <br/>
                    <br/>
                    <input type="submit" />

                </form>

            </div>

        </div>



    )

}

